Actionscript.script:
攻击时移动 = _root.敌人二级函数.攻击时移动;
攻击时四向移动 = _root.敌人二级函数.攻击时四向移动;

gotoAndPlay(_parent.近战招式);

onClipEvent(load){
   if(random(2) == 0)
   {
      是否移动 = true;
   }
   else
   {
      是否移动 = false;
   }
   if(random(2) == 0)
   {
      方向 = "上";
   }
   else
   {
      方向 = "下";
   }
}
onClipEvent (enterFrame) {
	if (是否移动)
	{
		_parent._parent.移动(方向,10);
	}
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 =  _parent._parent.空手攻击力 * 1.2;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 1;
	子弹属性.水平击退速度 = NaN;
	子弹属性.垂直击退速度 = NaN;

	//非常用
	/*
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.击中后子弹的效果 = "".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

